export default function ApprovedResumes({ approved,  columnsApproved}) {

    return (
        <div style={{ height: 400, width: '100%' }}>
            <DataGrid
                rows={approved}
                columns={columnsApproved}
                pageSize={5}
                rowsPerPageOptions={[5]}
                checkboxSelection
                onSelectionModelChange={(id) => { setCurrentId(id[id.length - 1]) }}
                pb={2}
            />
        </div>
    )
}
